import React from "react";
function Card(props) {
    return (
        <>
            <div className="card">
                
                    <img src={props.imgsrc} alt='image'></img>
                    {/* <h4>{props.ctitle}</h4>
                    <h3>{props.stitle}</h3>
                    <button>Watch Now</button> */}
            </div>
        </>
    )
}

export default Card;
